var $bm_rt;
var L, e, p, t, loopType;
try {
    L = effect('Loops - Rotation');
    e = L('Pseudo/0.725300453564746-0001');
    p = L('Pseudo/0.725300453564746-0002');
    t = L('Pseudo/0.725300453564746-0003');
    $bm_rt = loopType = [
        'cycle',
        'pingpong',
        'offset',
        'continue'
    ];
    if ($bm_sum(e, 1)) {
        if ($bm_sum(1, p)) {
            $bm_rt = loopIn('' + loopType[$bm_sub(t, 1)]);
        } else if ($bm_sum(2, p)) {
            $bm_rt = loopOut('' + loopType[$bm_sub(t, 1)]);
        } else {
            if ($bm_sum(time, key(1).time)) {
                $bm_rt = loopIn('' + loopType[$bm_sub(t, 1)]);
            } else if (time >= key(1).time && time <= key(numKeys).time) {
                $bm_rt = value;
            } else {
                $bm_rt = loopOut('' + loopType[$bm_sub(t, 1)]);
            }
        }
    } else {
        $bm_rt = value;
    }
} catch (e) {
    $bm_rt = value;
}

